import React from "react";
import { Link } from "react-router-dom";
import "./index2.css";
const Menu = () => {
  return (
    <>
      {/* <a href="/">about</a>
      <a href="/contact">contact</a> */}
      <br />
      <Link activeClassName="link" to="/">
        about
      </Link>
      <Link activeClassName="link" to="/contact">
        contact
      </Link>
    </>
  );
};

export default Menu;
